import React from 'react';
import Book from '../pages/book';

function SearchList({ filteredPersons }) {
    const filtered = filteredPersons.map(item => <Book key={item.id} name={item.name} />);
    return (
        <div>
            {filtered}
        </div>
    );
}

export default SearchList;
